import React from 'react';
import styled from 'styled-components';
import { useNavigate } from 'react-router-dom';

const SideBarContainer = styled.div`
  width: 100%;
  min-height: 100vh;
  background-color: #FFD700;
  padding: 20px;
`;

const MenuList = styled.ul`
  list-style-type: none;
  padding: 0;
`;

const MenuItem = styled.li`
  margin-bottom: 20px;
  font-size: 18px;
  color: #333;
`;

const CloseButton = styled.button`
  position: fixed;
  bottom: 20px;
  left: 50%;
  transform: translateX(-50%);
  padding: 10px 20px;
  background-color: #333;
  color: white;
  border: none;
  border-radius: 5px;
  font-size: 16px;
  cursor: pointer;
`;

const SideBarPage = () => {
  const navigate = useNavigate();

  const handleClose = () => {
    navigate(-1); // 이전 페이지로 돌아가기
  };

  return (
    <SideBarContainer>
      <MenuList>
        <MenuItem>해외 여행</MenuItem>
        <MenuItem>워킹 홀리데이</MenuItem>
        <MenuItem>어학 연수</MenuItem>
        <MenuItem>해외 취업</MenuItem>
        <MenuItem>출국 전 정보</MenuItem>
        <MenuItem>해외 생활 정보</MenuItem>
        <MenuItem>귀국 전 정보</MenuItem>
        <MenuItem>공동 구매</MenuItem>
      </MenuList>
      <CloseButton onClick={handleClose}>닫기</CloseButton>
    </SideBarContainer>
  );
};

export default SideBarPage;
